(* ::Input::Initialization:: *)
(*Evaluated form of the coefficients*)
acoefE[i_,j_][\[CapitalDelta]_,{l1_,l2_,l3_}]:=Simplify[(-(dim-2)+(1+i+j+KroneckerDelta[i,j]-llspin[i]-llspin[j]))/.{llspin[0]->-\[CapitalDelta]}/.llspin[nn_]:>({l1,l2,l3}[[nn]])];


(*How contracted derivatives act on functions. By default the coordinates 
are taken to be 0,1,,...,MC=4, and the polarizations 1,...,MP=3. This is enough
 for up to four point functions and three-row Young diagrams*)


(* ::Input::Initialization:: *)
PdP[j_,i_,f_,MC_:4,MP_:3]:=Sum[2^(1-Boole[aind!=i]) D[f,PP[aind,i]] PP[aind,j],{aind,0,MC}]+Sum[D[f,ZP[{aind,polind},i]] ZP[{aind,polind},j],{aind,0,MC},{polind,1,MP}];
ZdP[j_,i_,f_,MC_:4,MP_:3]:=Sum[-2^(2-Boole[aind!=i]) D[f,PP[aind,i]] ZP[j,aind],{aind,0,MC}]+Sum[D[f,ZP[{aind,polind},i]] Z2[{aind,polind},j],{aind,0,MC},{polind,1,MP}];
PdZ[j_,i_,f_,MC_:4,MP_:3]:=Sum[-(1/2) D[f,ZP[i,aind]] PP[aind,j],{aind,0,MC}]+Sum[2^(1-Boole[{aind,polind}!=i]) D[f,Z2[{aind,polind},i]] ZP[{aind,polind},j],{aind,0,MC},{polind,1,MP}];
ZdZ[j_,i_,f_,MC_:4,MP_:3]:=Sum[D[f,ZP[i,aind]] ZP[j,aind],{aind,0,MC}]+Sum[2^(1-Boole[{aind,polind}!=i]) D[f,Z2[{aind,polind},i]] Z2[{aind,polind},j],{aind,0,MC},{polind,1,MP}];
dPdP[j_,i_,f_,MC_:4,MP_:3]:=-2^(2-Boole[i!=j]) dim D[f,PP[i,j]]+Sum[-2^(3-Boole[aind!=i]-Boole[bind!=j]) D[D[f,PP[aind,i]],PP[bind,j]] PP[aind,bind],{aind,0,MC},{bind,0,MC}]+Sum[D[D[f,ZP[{aind,polind1},i]],ZP[{bind,polind2},j]] Z2[{aind,polind1},{bind,polind2}],{aind,0,MC},{bind,0,MC},{polind1,1,MP},{polind2,1,MP}]+Sum[-2^(2-Boole[aind!=i]) D[D[f,PP[aind,i]],ZP[{bind,polind2},j]] ZP[{bind,polind2},aind]-2^(2-Boole[aind!=j]) D[D[f,PP[aind,j]],ZP[{bind,polind2},i]] ZP[{bind,polind2},aind],{aind,0,MC},{bind,0,MC},{polind2,1,MP}];
dZdZ[j_,i_,f_,MC_:4,MP_:3]:=2^(1-Boole[i!=j]) dim D[f,Z2[i,j]]+Sum[-(1/2) D[D[f,ZP[i,aind]],ZP[j,bind]] PP[aind,bind],{aind,0,MC},{bind,0,MC}]+Sum[2^(2-Boole[{aind,polind1}!=i]-Boole[{bind,polind2}!=j]) D[D[f,Z2[{aind,polind1},i]],Z2[{bind,polind2},j]] Z2[{aind,polind1},{bind,polind2}],{aind,0,MC},{bind,0,MC},{polind1,1,MP},{polind2,1,MP}]+Sum[2^(1-Boole[{aind,polind1}!=i]) D[D[f,Z2[{aind,polind1},i]],ZP[j,bind]] ZP[{aind,polind1},bind],{aind,0,MC},{bind,0,MC},{polind1,1,MP}]+Sum[2^(1-Boole[{bind,polind2}!=j]) D[D[f,ZP[i,aind]],Z2[{bind,polind2},j]] ZP[{bind,polind2},aind],{aind,0,MC},{bind,0,MC},{polind2,1,MP}];
dZdP[j_,i_,f_,MC_:4,MP_:3]:=dim D[f,ZP[j,i]]+Sum[2^(1-Boole[aind!=i]) D[D[f,PP[aind,i]],ZP[j,bind]] PP[aind,bind],{aind,0,MC},{bind,0,MC}]+Sum[2^(1-Boole[{bind,polind2}!=j]) D[D[f,ZP[{aind,polind1},i]],Z2[{bind,polind2},j]] Z2[{aind,polind1},{bind,polind2}],{aind,0,MC},{bind,0,MC},{polind1,1,MP},{polind2,1,MP}]+Sum[D[D[f,ZP[{aind,polind1},i]],ZP[j,bind]] ZP[{aind,polind1},bind],{aind,0,MC},{bind,0,MC},{polind1,1,MP}]+Sum[-2^(3-Boole[aind!=i]-Boole[{bind,polind2}!=j]) D[D[f,PP[aind,i]],Z2[{bind,polind2},j]] ZP[{bind,polind2},aind],{aind,0,MC},{bind,0,MC},{polind2,1,MP}];


